import React from 'react'
import './App.css'
import CreateNabar from './Components/Navbar'
import { Route, Switch } from 'react-router-dom'
import Routing from './Services/Routing'
import FloorPlan from './Components/Floor/FloorPlan'


function App() {
  return (
    <React.Fragment>
      <header>
        <CreateNabar />
      </header>
      <main>
          <Routing />
          <FloorPlan />
      </main>
    </React.Fragment>
  );
}

export default App;
